import React, { useState } from "react";
import { Formik, Form, Field, useFormik } from "formik";
import * as Yup from "yup";
import { TextField } from "material-ui-formik-components/TextField";
import { Select } from "material-ui-formik-components/Select";
import Password from "./FormikField/Password";

function SignUpFormCompanyy() {
  const mockitems = [
    { label: "ist", value: 34 },
    { label: "ankara", value: 6 },
  ];
  const yup = require("yup");
  require("yup-password")(yup);

  const sigUpSchema = Yup.object().shape({
    name: Yup.string()
      .min(2, "Company name is too short")
      .required("Company name is required"),
    email: Yup.string()
      .email("Please enter a valid email")
      .required("Email is required"),
    city: Yup.number().required("Please select a city"),
    password: Yup.string()
      .password()
      .required("Password is required")
      .min(8, "pass 8")
      .minLowercase(1, "has min low")
      .minUppercase(1, "has min high")
      .minNumber(1, "has min num")
      .minSymbol(1, "has min sym"),
    // confirmPassword: Yup.string().oneOf(
    //   [Yup.ref("password"), null],
    //   "Passwords must match"
    // ),
  });
  const [values, setValues] = React.useState({
    showPassword: false,
  });
  const handleClickShowPassword = () => {
    setValues({ ...values, showPassword: !values.showPassword });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };
  return (
    <Formik
      initialValues={{
        name: "",
        city: "",
        email: "",
        password: "",
        confirmPassword: "",
      }}
      onSubmit={(values) => {
        alert(
          `Name: ${values.name}\nCity: ${values.city}\nEmail: ${values.email}`
        );
      }}
      validationSchema={sigUpSchema}
    >
      {(formik) => (
        <Form>
          <Field name="name" label="Name" component={TextField} />
          <Field
            name="email"
            label="Email"
            type="email"
            component={TextField}
          />
          <Field
            required
            fullWidth
            name="city"
            label="City"
            options={mockitems}
            component={Select}
          />
          <FormControl>
            <InputLabel htmlFor="standard-adornment-password">
              Password
            </InputLabel>
            <Input
              id="standard-adornment-password"
              type={values.showPassword ? "text" : "password"}
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                  >
                    {values.showPassword ? <Visibility /> : <VisibilityOff />}
                  </IconButton>
                </InputAdornment>
              }
            />
          </FormControl>
          <button type="submit" disabled={!formik.dirty || !formik.isValid}>
            Submit
          </button>
        </Form>
      )}
    </Formik>
  );
}

export default SignUpFormCompanyy;
